import React from 'react';
import './CameraFeed.css';

function CameraFeed() {
    return (
        <section id="camera-feed">
            <div className="container">
                <video id="video" width="720" height="560" autoplay muted></video>
            </div>
        </section>
    );
}

export default CameraFeed;
